docs/guides/ClientServerPrefixing.html.body:
Client / Server Prefixing
The most important requirement often is to be able to render universally, thus both on server and client. Both the dynamic and the static version are capable of universal rendering.
Static Prefixing
If you&apos;re using the static prefixer, you won&apos;t have any issues with universal rendering at all, as it works seamlessly on both sides.
Dynamic Prefixing
With the dynamic version, on the other hand, we have to do some additional steps to be able to prefix correctly on the server-side as well.
The problem is, that on the client-side it uses the navigator.userAgent to detect the required vendor prefixes. But, on server-side, we do not have the navigator.userAgent set at all. Still we can get the userAgent from the request. Check the following server-side example:
import express from &apos;express&apos;
import Prefixer from &apos;inline-style-prefixer&apos;

const server = express()

server.get(&apos;/&apos;, (req, res) =&gt; {
  const reqUserAgent = req.headers[&apos;user-agent&apos;]

  const prefixer = new Prefixer({
    userAgent: reqUserAgent
  })

  // do anything with the prefixer
})

docs/guides/ResolvingArrays.html.body:
Resolving Array Values
Sometimes, vendor prefixed styles require multiple values for a single property. Technically, we can&apos;t have multiple values for a single key in a JavaScript object. That&apos;s why both prefixer use an array of values instead e.g.
{
  display: [ &apos;-webkit-flex&apos;, &apos;-moz-flex&apos;, &apos;flex&apos; ]
}

Yet, these arrays cannot be used as is. If you&apos;re using inline styles you need to resolve them. Many other CSS-in-JS solutions, might provide functionality to resolve them automatically, but it is not ensured.
Basically, we want to get single string out after all.
The above example would be transformed to the following valid CSS string:
{
  display: &apos;-webkit-flex;display:-moz-flex;display:flex&apos;
}

To achieve that, I recommend using resolveArrayValue(propety, value) provided by css-in-js-utils.
Example
import { resolveArrayValue } from &apos;css-in-js-utils&apos;

const displayValue = [ &apos;-webkit-flex&apos;, &apos;-moz-flex&apos;, &apos;flex&apos; ]

resolveArrayValue(&apos;display&apos;, displayValue)
// =&gt; &apos;-webkit-flex;display:-moz-flex;display:flex&apos;

docs/guides/CustomPrefixer.html.body:
Creating your own Prefixer
If your application requires different browser version support, you might consider creating your own Prefixer. To make it as simple as possible, we provide two different tools to get there. First of all, we have the inline-style-prefixer/generator that helps to generate the required prefixing data. Then, you can use createPrefixer to plug it all together.
Generating dynamic data
Each Prefixer needs to know which properties to prefix and which plugins to use. This data can be generated using generateData.
You need to provide a browserList containing all the minimum browser versions that should be supported.
It will then generate the required data and save it to dynamicPath. Check out the generateData API reference for detailed information on all the options and advanced settings.
import generateData from &apos;./modules/generator&apos;

const browserList = {
  chrome: 46,
  android: 4,
  firefox: 40,
  ios_saf: 8,
  safari: 8,
  ie: 11,
  ie_mob: 11,
  edge: 12,
  opera: 16,
  op_mini: 12,
  and_uc: 9,
  and_chr: 46
}

generateData(browserList, {
  dynamicPath: `${__dirname}/modules/dynamic/dynamicData.js`
})

Creating the Prefixer
Now that we have the data, we simply need to use the createPrefixer helper.

As the dynamic prefixer uses the static prefixer as a fallback, we also need to provide a static fallback. We recommend to generate your own prefixAll-method using the same browserList for compatibility reasons.

import createPrefixer from &apos;inline-style-prefixer/dynamic/createPrefixer&apos;

import dynamicData from &apos;./modules/dynamic/dynamicData&apos;
import prefixAll from &apos;./modules/static/prefixAll&apos;

const Prefixer = createPrefixer(dynamicData, prefixAll)

const prefixer = new Prefixer()

docs/api/inline-style-prefixer/Prefixer..body:
Prefixer
Constructor
Creates a new dynamic prefixer instance.
Arguments

config (Object?): Prefixer configuration. See Configuration for possible options.

Returns
(Prefixer): Prefixer instance.
Example
import Prefixer from &apos;inline-style-prefixer&apos;

const prefixer = new Prefixer()

Configuration



Option
Type
Default
Description




userAgent
(string)
navigator.userAgent
The userAgent that is used to detect required prefixes


keepUnprefixed
(boolean)
false
Keep default (unprefixed) properties and values



const customUserAgent = &apos;Mozilla/5.0 (Macintosh; Intel Mac OS X 10_11_0) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/44.0.2403.155 Safari/537.36&apos;

const prefixer = new Prefixer({
  userAgent: customUserAgent,
  keepUnprefixed: true
})


prefix(style)
Adds all required vendor prefixes to a style object.
Arguments

style (Object): An object containing valid style declarations.

Returns
(Object): An object containing all style declarations with modified vendor prefixes.
Example
import Prefixer from &apos;inline-style-prefixer&apos;

const style = {
  transition: &apos;200ms all linear&apos;,
  userSelect: &apos;none&apos;,
  boxSizing: &apos;border-box&apos;,
  display: &apos;flex&apos;,
  color: &apos;blue&apos;
}

const prefixer = new Prefixer()
const prefixedStyle = prefixer.prefix(style)

// Assuming you are using e.g. Chrome version 25
// prefixedStyle === output
const output = {
  transition: &apos;200ms all linear&apos;,
  WebkitUserSelect: &apos;none&apos;,
  boxSizing: &apos;border-box&apos;,
  display: &apos;-webkit-flex&apos;,
  color: &apos;blue&apos;
}

Example using keepUnprefixed
import Prefixer from &apos;inline-style-prefixer&apos;

const styles = {
  userSelect: &apos;none&apos;,
  display: &apos;flex&apos;
}

const prefixer = new Prefixer({ keepUnprefixed: true })
const prefixedStyles = prefixer.prefix(styles)

// Assuming you are using e.g. Chrome version 22
// prefixedStyles === output
const output = {
  WebkitUserSelect: &apos;none&apos;,  
  // unprefixed properties do not get removed
  userSelect: &apos;none&apos;,
  // unprefixed values will be kept in arrays
  display: [ &apos;-webkit-flex&apos;, &apos;flex&apos; ]
}


Properties
Every Prefixer instance also provides prefix information.
// e.g. using a Chrome version 40 userAgent
prefixer.cssPrefix = &apos;-webkit-&apos;
prefixer.jsPrefix = &apos;Webkit&apos;
prefixer.prefixedKeyframes = &apos;-webkit-keyframes&apos;

docs/api/inline-style-prefixer/createPre.body:
createPrefixer(data, staticFallback)
Creates a custom Prefixer class with your custom browser support range. It should be used together with generateData provided by inline-style-prefixer/generator to generate the required data.
Arguments

data (Object): An object containing the prefixMap and plugins list - (generated with inline-style-prefixer/generator - check how to generate your own)
staticFallback (Function): A static prefixer which is used as a fallback- (It should be generated using the inline-style-prefixer/generator together with the static createPrefixer)

Returns
(class): Returns a custom Prefixer class.
Example
import createPrefixer from &apos;inline-style-prefixer/dynamic/createPrefixer&apos;

import dynamicData from &apos;./generatedData&apos;
import staticFallback from &apos;./staticFallback&apos;

export default createPrefixer(
  dynamicData,
  staticFallback
)

which can the be used e.g.
import Prefixer from &apos;./customPrefixer&apos;

const prefixer = new Prefixer({
  userAgent: &apos;&apos;,
  keepUnprefixed: false
})

const prefixed = prefixer.prefix({
  transition: &apos;300ms all linear&apos;,
  flex: 1
})

docs/api/inline-style-prefixer-static/pr.body:
prefixAll(style)
Adds all available vendor prefixes to the style object.
Arguments

style (Object): An object containing valid style declarations.

Returns
(Object): An object containing all style declarations with vendor prefixes.
Example
import prefixAll from &apos;inline-style-prefixer/static&apos;

const style = { alignItems: &apos;center&apos; }

const prefixedStyle = prefixAll(style)

// the userAgent doesn&apos;t matter
// prefixedStyles === output
const output = {
  WebkitAlignItems: &apos;space-around&apos;,
  msAlignItems: &apos;space-around&apos;,
  alignItems: &apos;space-around&apos;,
  // it also adds legacy properties and values
  // by running every plugin available
  WebkitBoxAlign: &apos;justify&apos;,
  msFlexAlign: &apos;distribute&apos;,
}

docs/api/inline-style-prefixer-static/cr.body:
createPrefixer(data)
Creates a custom static prefixer function with your custom browser support range. It should be used together with generateData provided by inline-style-prefixer/generator to generate the required data.
Arguments

data (Object): An object containing the prefixMap and plugins list - (generated with inline-style-prefixer/generator - check how to generate your own)

Returns
(Function): Returns a custom prefixAll function.
Example
import createPrefixer from &apos;inline-style-prefixer/static/createPrefixer&apos;

import staticData from &apos;./generatedData&apos;

export default createPrefixer(
  staticData
)

which can the be used e.g.
import prefixAll from &apos;./customPrefixAll&apos;

const prefixed = prefixAll({
  transition: &apos;300ms all linear&apos;,
  flex: 1
})
